function isValidHttpUrl(string) {
    let url

    try {
        url = new URL(string)
    } catch (_) {
        return false
    }

    return url.protocol === "http:" || url.protocol === "https:"
}

function isEmpty(x) {
    return (
        x === null || x === undefined || (typeof x == "string" && x.trim() === "")
    )
}

function isNotEmpty(x) {
    return !isEmpty(x)
}

